INSERT INTO `mjnews` VALUES (4,'MAHESHWARI JAGRUTH - An Initiative towards community development',NULL,'Hyderabad','2013-09-10 14:26:27','2013-09-10 14:26:27','BANNER.jpg','image/jpeg',83675,'2013-09-10 14:26:26','JAI MAHESH, Longing for something that will change the outlook of our Community, Searching for a Chance to be socially active in this super fast Era ? Well The hunt is over. Maheshwari Jagruth is here launching a complete package of our Maheshwari Community comprising of Family Directory, Social Events , Live Coverages , News, MJ Shoppe , New Ventures , Interactive Blogs and much more under the name MJ.',' The objective behind it is the betterment of the community and specially designed for all the members from youth to Retired , from Working class to Busy Housewives. To be a part of this project just register yourself in www.maheshwarijagruth.com . which is just a click away',' \"KOI BHI SAMAJ JAB UNNATI KARTA HAI , TOH PRAKRANTAR ROOP SE DESH UNNATI KARTA HAI\" Seva Mein Aapke, Maheshwari Jagruth Team JOIN US BY ECHOING THIS MESSAGE TO THE MAHESHWARI COMMUNITY');
